$(document).ready(function () {
    $('.banner-carousel').owlCarousel({
        dots: true,
        items: 1,
        nav: true,
        navText: [
            "<img class='arrow' src=/site/themes/hdm/img/arrow-white.png><img class='active' src=/site/themes/hdm/img/arrow-active.png>",
            "<img class='arrow' src=/site/themes/hdm/img/arrow-white.png><img class='active' src=/site/themes/hdm/img/arrow-active.png>"
        ]
    });
    $('.steps-carousel').owlCarousel({
        dots: true,
        items: 1
    });

    setCurrentLanguage();
    $('.tokenfield').tokenfield();
    loadScore();
    $(window).resize(checkSize);
    openLinksInNewTab();
    openZoomImages();
    hideButtonMoreActivities();
    hideButtonMoreRestaurants();
    hideButtonMorePhotos();
});

/* Search submit on enter */
$('body').on('keyup', '.token-input', function(event){
    if (event.keyCode == 13) {
        $("#form-search").submit();
    }
});

/* Smooth scrolling */
$(function () {
    $('a[href*="#"]:not([href="#"])').click(function () {
        if (location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') && location.hostname == this.hostname) {
            var target = $(this.hash);
            target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
            if (target.length) {
                $('html, body').animate({
                    scrollTop: target.offset().top
                }, 1000);
                return false;
            }
        }
    });
});

/* Navbar */
$('.search-trigger').click(function () {
    var inputSearch = $('.tokenfield.form-control'),
        nav = $('.navbar-hdm');

    inputSearch.toggleClass('grow');
    $('.search .helper').toggleClass('grow');
    $('#helper-search').toggleClass('display');
    if (inputSearch.hasClass('grow')) {
        $('#search-icon').removeClass('hidden');
        $('#search-icon-transparent').addClass('hidden');
    } else if (!nav.hasClass('navbar-beige')) {
        $('#search-icon').addClass('hidden');
        $('#search-icon-transparent').removeClass('hidden');
    }
    nav.toggleClass('navbar-search');
});

$('.languages-trigger').click(function () {
    $('#menu-languages').toggleClass('open');
});

$('.menu-trigger').click(function () {
    $(this).toggleClass('open');
    $('.menu').toggleClass('open');
});

/* Language selected */

function setCurrentLanguage() {
    $('.language').removeClass('active');
    var language = window.location.pathname.split("/")[1],
        es = $('#language-es'),
        en = $('#language-en');
    switch (language) {
        case "en":
            en.addClass('active');
            en.attr('href', '#');
            break;
        case "es":
            es.addClass('active');
            es.attr('href', '#');
            break;
        default:
            en.addClass('active');
            en.attr('href', '#');
            break;
    }
}

/* Home away from home */
var membershipBasicsList = $('#membership-basics-list'),
    option = $('.membership-list-option');

