function loadScore() {
    var score = $('#score').text(),
        completeStars = parseInt(score),
        decimal = parseFloat(score) % 1,
        width = decimal.toFixed(1) * 100;

    for (var i = 1; i <= completeStars; i++) {
        var star = $('#score-' + i);
        star.css('width', '100%');
    }
    $('#score-' + (completeStars + 1)).css('width', width + '%')
}


